import React from "react";

function DataTable({ columnID, data }) {
  //   <>
  //     <div className="row"></div>
  //     <hr></hr>
  //   </>;

  return (
    <>
      {data == null ? (
        <div className="data-table">Loading...</div>
      ) : (
        Object.keys(data).map((columnID) => (
          <TableColumn columnID={columnID} data={data[columnID]} />
        ))
      )}
    </>
  );
}

export default DataTable;
